Je m'appelle Lou, je suis à la Fac en licence Science de l'Education et de la Formation afin de devenir, plus tard, professeure des écoles (mon rêve depuis toute petite). Je suis quelqu'un de dynamique, à l'écoute, responsable, calme et douce. J'ai plusieurs experiences au près des enfants :
- Ma maman est assistante-maternelle, j'ai donc l'habitude de m'occuper d'enfant de tout âge, depuis que je suis petite ;
- J'ai fait mon stage de 3e dans une école maternelle où j'ai pu passer une journée dans chaque niveau ;
- Et enfin, j'ai gardé une enfant de 4 ans pendant les deux semaines de vacances d'octobre 2023, j'ai pu, avec elle, faire des activités ludiques et créatives tel que des puzzle, de la peinture, des dessins et des collages pour faire des jolies décorations pour Halloween. Je lui donnait ses repas (déjeuner et goûter) et enfin, je lui lisais une histoire avant sa sieste.
Mes disponibilités ne sont pas fixes, mais je suis surtout libre le vendredi à partir de 16h et le samedi. 
N'hésitez pas à me contacter pour quelconque question !
